export default  function ActivePatient(){
    return (
        <div>
            <h1> this is Actvie patient</h1>
            <h1> Search bar to search patient </h1>
            <h2> the result should list if patient is in the data </h2>
            <h2> NO result will show if patient was not seen </h2>
            <PatientList/>
        </div>
    )
}
